function Dropdown() {
  return (
    <div className='dropdown'>
      <div className='dropdown-content'>
        <div className='dropdown-item'>
        Easy
        </div>
        <div>
          Medium
        </div>
      </div>
    </div>
  );
}

export default Dropdown;
